import React from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
import notes from "../notes";

function createNote(oneNote){
    return <Note 
        title = {oneNote.title}
        description = {oneNote.content}
    />

}

function App(){
    return <div>
        <Header />
        <Note />
        <Footer />
    </div>
}

export default App
